import * as React from "react";
import { RestaurantState } from "./../../typing/data";
import {
	ALlDetail,
	TextDetail,
	Button,
	PlainText,
} from "../../container/style";
import Slider from "react-slick";

interface IItemLIst {
	data: RestaurantState;
}

const ItemList: React.FC<IItemLIst> = (props) => {
	console.log("data", props.data);
	var settings = {
		dots: true,
		arrows: false,
	};
	return (
		<>
			<ALlDetail>
				<Slider {...settings}>
					{
						props.data.image.map((img:string)=>(
<div>
						<img src={props.data.image} width="250" alt={props.data.name}  />
					</div>
						))
					}

				</Slider>
				{/* <img
					src={props.data.img}
					alt={props.data.name}
					width="230"
					// height="600"
				/> */}
				<p style={{paddingTop:'10px'}}>{props.data.name}</p>

				<TextDetail>
					<PlainText>Total Queue</PlainText>
					<PlainText>{props.data.people}</PlainText>
				</TextDetail>
				<TextDetail>
					<PlainText>Free Queue</PlainText>
					<PlainText>{props.data.people}</PlainText>
				</TextDetail>
				<Button>Booking</Button>
			</ALlDetail>
		</>
	);
};
export default ItemList;
